Meteor.startup(function() {
	Meteor.users.find({
		"status.online": true
	}).observe({
		added: function(obj) {
			console.log(obj._id + ' online');
			Data.Status.insert({
				status: "online"
			});
		},
		removed: function(obj) {
			console.log(obj._id + ' offline');
			Data.Status.insert({
				status: "offline"
			});
		}
	});
});
